import { createIconSet } from '@expo/vector-icons';
const glyphMap = require(`../../assets/fonts/remixicon.glyphmap`);
import * as Font from 'expo-font';

var RemixIcon = null;

if (Font.isLoaded("RemixIcon")) {
    RemixIcon = createIconSet(glyphMap, 'remix-icon', 'remixicon.ttf');
}

export default RemixIcon;
